import React, { Component } from "react";
import styled from "styled-components";

class Inputs extends Component {
  render() {
    const Div_inputs_outline = styled.div`
    width: 1112px;
    height: 296px;
    margin: 0 auto;
    position: relative;
    top: -624px;

    `;

  const P_title_beans = styled.p`
  font-family: "Alegreya Sans", sans-serif;
  font-size: 35px;
  font-weight: 600;
  color: #ffffff;
  margin: 0;
`;

const P_subtitle_beans = styled.p`
font-family: "Alegreya Sans", sans-serif;
font-size: 20px;
font-weight: 300;
color: #ffffff;
margin: 0;

`;


const Img_beans = styled.img`
  width: 24px;
  height: 24px;
  object-fit: contain;
`




    return (
        <Div_inputs_outline>
        <P_title_beans>BE
        <Img_beans src={require("./beansimage.png")}/>
        NS
        </P_title_beans>
        <P_subtitle_beans> adf</P_subtitle_beans>

        </Div_inputs_outline>
    );
  }
}

export default Inputs;
